(262, 'ED22D9FD-CF8C-47A8-82FC-41388F36966D', 'But I️’d like to know the answer to that question now ', 'Nitzan', 'David', '2024-08-30T11:05:19.434720'),
(245, 'BEA46514-0FA2-4E45-A9CF-67F46EB8BDF5', 'And also please make sure to read all of my texts about logistics ', 'Nitzan', 'David', '2024-08-30T11:05:41.552608'),
(342, 'AB671E48-B63D-4D10-8DD0-8F66D9E22D42', 'There are a good number of things I️ need you to bring up ', 'Nitzan', 'David', '2024-08-30T11:06:02.835718'),
(344, '938A5EA6-5AC4-4B95-AD84-7889ED7A7490', 'Also I️ left a bag with challah near the food. ', 'Nitzan', 'David', '2024-08-30T11:06:19.040394'),
(210, 'F01F37D6-94D2-44E9-91CD-205E9F6FF3CC', 'Please bring those too ', 'Nitzan', 'David', '2024-08-30T11:06:26.162425'),
(307, 'FF032C2E-45B3-47D9-9C1E-33F49CEF2259', 'We had breakfast, cleaned up the place and we did have sex. Was that not okay? I don’t remember making a commitment that we would not have any physical contact. Your request was that we not do that in the house. ', 'David', 'Nitzan', '2024-08-30T11:32:06.792000'),
(226, '4B922E3D-90EF-4989-B12A-3EFD2DE88BF8', 'Got it', 'David', 'Nitzan', '2024-08-30T11:33:22.895000'),
(305, '04DB61B3-35BE-497D-984D-8EDCDCE85D70', 'It wasn’t about the commitment per se. it was about expectations management. You said “I️ think we aren’t going to do that again this morning because it will be too much for her and we are kinda past that for today.” You played up the caviler “we are just saying goodbye and having a quick breakfast.” So then when that’s exactly the opposite of what happens, it’s hard for me.', 'Nitzan', 'David', '2024-08-30T11:50:15.156128'),
(298, 'D6BFB361-32F9-4945-9E0A-37DEA38D5952', 'I️ think just the vibe of “it’s so relaxed and chill and cool and whatever…” and then I️ watched you bolt out of the house as fast as humanely possible just sends the opposite vibe and makes it feel a lot more intense. ', 'Nitzan', 'David', '2024-08-30T11:51:17.000258'),
(330, '2A8D74EC-C3A1-4108-B19F-56DBE455974A', 'I️ just think you really blew it this morning with managing my expectations and playing down everything. That reminds me of older days and makes me feel really bad.', 'Nitzan', 'David', '2024-08-30T11:51:51.762235'),
(348, '191B80F0-5735-421E-B5FF-6C9129429123', 'And you forget to even help me feel ok when you saw I️ was anxious ', 'Nitzan', 'David', '2024-08-30T11:52:13.159169'),
(243, '08DC3914-80B2-4271-BF3B-DC2AA289981A', 'I️ told you at the beginning of this three day thing that I️ needed a lot of love and attention ', 'Nitzan', 'David', '2024-08-30T11:52:52.373770'),
(462, '0ADCE816-5530-4354-B046-635C9C2A4B8A', 'We are leaving CCJDS now ', 'Nitzan', 'David', '2024-08-30T12:10:05.835860'),
(355, '890B8578-3726-4402-BF1F-BC5F228EE3D3', 'On the I’m sorry I didn’t help make you feel less anxious and keep up my commitment to send you love this morning.  I am leaving now and we can talk later.', 'David', 'Nitzan', '2024-08-30T12:10:16.052000'),
(194, '8990EFE3-0449-4FF3-A834-48E8431A89E5', 'So our arrival is 2:30', 'Nitzan', 'David', '2024-08-30T12:10:51.123645'),
(390, 'B866091E-6D55-4CB0-A3B3-1D0913D7B91A', 'Will be there before 3', 'David', 'Nitzan', '2024-08-30T12:10:54.694000'),
(168, 'B5E59985-AC50-432E-8322-977D878BA1C2', 'Ok ', 'Nitzan', 'David', '2024-08-30T12:11:42.765983'),
(177, 'F347E0A6-EFF1-47B8-A38B-205FE552ECEC', 'We are in del rio and going to shop for ice cream for the girls ', 'Nitzan', 'David', '2024-08-30T13:11:40.728964'),
(358, '7F9FA858-B0C9-4489-A684-723F97CA35E1', 'OK. I met some weird standstill traffic. Perhaps there was an accident. It’s now saying 315.', 'David', 'Nitzan', '2024-08-30T13:28:08.069000'),
(278, 'E49E772B-1EC1-4745-8644-9F634EE16013', 'We are stopping at Mel’s mocha and ice cream ', 'Nitzan', 'David', '2024-08-30T13:30:11.077741'),
(386, '591B8DE0-00D1-468D-9624-ACBD5723FB4C', 'I’m 15 minutes out', 'David', 'Nitzan', '2024-08-30T15:18:25.135000'),
(363, 'F7752EAF-3312-48DA-9848-AE4D829BA53B', 'All the men are here in case you want to change your mind ', 'Nitzan', 'David', '2024-09-02T11:46:58.634882'),
(308, 'CE25CCBD-096A-4955-AF9A-C18CEA120345', 'Thanks love. While I’d like to, I need to have a bit of processing time right now.  Been listening to David epstein’s podcast and has me thinking about a few threads I’m trying to pull together. ', 'David', 'Nitzan', '2024-09-02T11:57:42.222000'),
(353, 'A0524252-1D7C-4865-BA75-0B36D8882995', 'Sure thing! ', 'Nitzan', 'David', '2024-09-02T12:49:59.551844'),
(189, 'ABF7FE26-C184-4417-91AD-3FBC780643AC', 'We’ll be back at 4ish. Can you please walk Kiki before we get back. I️’ll do the laundry and pack while you clean the car. I️’ll read with orli when you prepare dinner. Let’s plan to eat at around 5:15.', 'Nitzan', 'David', '2024-09-02T12:50:45.355326'),
(352, 'F846F35B-ED32-4657-9071-B30F9363B8D7', 'Got dinner pre-made a bit to make it easier', 'David', 'Nitzan', '2024-09-02T14:58:29.533000'),
(277, 'D5CD3705-D88E-406F-B69D-E144B76086C9', 'I walked Kiki already ', 'David', 'Nitzan', '2024-09-02T14:58:36.740000'),
(77, '7051DF5B-5C73-497F-A885-2C38E2A73D22', 'Hi love. First message from my new computer. Hope you are arriving shortly in Monterey', 'David', 'Nitzan', '2024-09-02T22:14:39.604856'),
(66, '8D9D3725-14A7-424C-B3D1-9C1717619E4B', 'Hi love! How’s the new computer? ', 'Nitzan', 'David', '2024-09-02T22:17:05.618796'),
(163, '216C7A00-75AE-41EB-8E17-EFCB02297EB7', 'Im just getting into bed right now. And reflecting on the last 5 days, I want to express my deepest gratitude and love to you. I do appreciate how much you had to stretch to enable my time with Misha. I don’t at all take it for granted. ', 'David', 'Nitzan', '2024-09-02T22:17:22.946110'),
(131, 'B631DC6B-26F6-40DF-97CB-14348F77FD83', 'I️ just got to my hotel!', 'Nitzan', 'David', '2024-09-02T22:17:29.559665'),
(126, '75D88E53-E399-48D5-808F-65726D0FDA43', 'And returning to be with you and Orli and our family and friends…and then capping with a night at Chochmat….felt just right. ', 'David', 'Nitzan', '2024-09-02T22:18:23.386285'),
(286, '17E3E941-FD08-46DE-9DFD-B4C1DE8D84CF', 'So much richness. So much wonderful exploration. And being with you makes it all possible.  Misha commented to me how you are fire (her reflection from the few minutes you met). And it is true. Your fire just renews day after day….as I said while we are on shrooms….you are just so hot, you need to have ice all the time in your body (while I need to drink tea!) The warmth and the heat and the hotness. I love you in all your fiery-ness. ', 'David', 'Nitzan', '2024-09-02T22:24:02.759801'),
(246, 'EFB302AD-53A4-4028-BFB5-2390D348E16B', 'I am falling asleep. So with that, goodnight my love! ', 'David', 'Nitzan', '2024-09-02T22:38:07.499000'),
(89, 'E50E4C84-C083-4405-937F-081A35E492A1', 'Hi love. Just got settled just to my bed after checking in.', 'Nitzan', 'David', '2024-09-02T22:53:18.578575'),
(69, '71637C03-35E7-48C0-BCAE-97A5F111AA67', 'Was listening to david Epstein’s podcast on the way. Man that guy is just a beast of a human. Talk about someone who is on fire. He is just beyond a unique brain. ', 'Nitzan', 'David', '2024-09-02T22:53:59.111094'),
(120, '3998B1BB-D134-4024-9ECB-5AE5A056818E', 'I️ feel like I️’ll have to listen to that podcast like 5 times to internalize it all ', 'Nitzan', 'David', '2024-09-02T22:54:19.764631'),
(111, 'DCE7DCF1-04E2-497B-8C81-4DBDEF02542A', 'And thanks for this lovely and kind note. I️ did have to stretch a lot to make last week make sense. And to be honest there were many moments where I️ was really regretting the decision. And while I️ don’t see myself saying yes to that kind of prolongated hang out again, I️’m genuinely happy that you got that experience with Misha and relished the connection. ', 'Nitzan', 'David', '2024-09-02T22:56:43.622181'),
(159, 'C2DEBDDD-76F3-4AB4-BB89-D16DACD48A95', 'It was an excellent weekend with the river folks and for building our community at Chochmat. I️ also had such a lovely afternoon of debate and fire with Nir, Jay, Halleli and Pamela while the kids frolicked and enjoyed the pool. Feels good to be a part of many communities and to be building connection in quite a number of places. ', 'Nitzan', 'David', '2024-09-02T22:58:10.664528'),
(72, 'EC12FCC1-AEEA-4AF5-B0EB-9BFDE915392F', 'You and I️ are living well in every sense of the word. My love and admiration for you only grows by the day. I’m proud of you for all the stretching you are doing and for living into your groundedness. ', 'Nitzan', 'David', '2024-09-02T22:59:43.049466'),
(81, '9E3D70B2-A167-415C-A83F-C820BE4E0A5B', 'I️’m feeling so very heartbroken about Israel today. I was glad to be with some Israeli’s to process it', 'Nitzan', 'David', '2024-09-02T23:00:18.620655'),
(99, '073C1418-43C0-4307-AA91-5C24E1719B01', 'Sorry, I can''t talk right now.', 'David', 'Nitzan', '2024-09-03T10:44:55.349000'),
(134, 'DF5D8777-53A9-4B72-A0FF-C9C3E83F0EE1', 'Ok ', 'Nitzan', 'David', '2024-09-03T10:45:27.207042'),
