(78, 'F687191F-EEED-4B84-B370-08A51C36EB45', 'Hi love. Have time to say hello? Just came back from a 5 mile run after my presentation!', 'Nitzan', 'David', '2024-09-03T17:16:38.701483'),
(251, 'ADEA8170-9AB5-4D82-9FA5-114AD1F5A85C', 'Or we can chat when you get home. I️ miss you ', 'Nitzan', 'David', '2024-09-03T17:16:49.425153'),
(228, '6455FEBA-4DFA-4F9C-9470-F62389C3B846', 'What are your plans for the evening? ', 'Nitzan', 'David', '2024-09-03T17:16:58.593211'),
(107, '51FF46DE-E199-42D0-9EA6-83F0BC282ACE', 'Hey love, just heading out to meet up with Anya. Thinking of you and wishing we can come back home with you. I hope you’re really enjoying meeting people and enjoying the beauty of Monterey. I love you. Can’t wait to see you tomorrow night.', 'David', 'Nitzan', '2024-09-03T18:37:16.620000'),
(61, 'BA9EDA85-6B6C-4474-A025-12A99D5A21D3', 'Hi love. I️’m back in my room. ', 'Nitzan', 'David', '2024-09-03T22:15:59.359006'),
