(53, 'F16E683F-94A4-484C-BB3B-7CFC45DFB574', 'And asked you to coordinate with her on times ', 'Nitzan', 'David', '2024-09-03T22:17:48.665018'),
(63, '64A7D619-1D7A-4476-A6C9-1C3083E347EE', 'I had coordinated a time. ', 'David', 'Nitzan', '2024-09-03T22:21:15.689000'),
(28, '873A1040-A3CB-4C5C-99C7-75483BFD6B69', 'But then why was she asking? ', 'Nitzan', 'David', '2024-09-03T22:21:29.650918'),
