(157, '6F68D972-3197-4140-AB3F-DBDF6E2CC1CC', 'She wrote at 10:07 “hi! Just wondering when you guys will be home? My parents are wondering”', 'Nitzan', 'David', '2024-09-03T22:22:20.674821'),
