(135, '7D2C87BE-5846-44E1-A4C0-0D9068B5999E', 'Ok when you get home ask her about it ', 'Nitzan', 'David', '2024-09-03T22:22:48.397702'),
(29, 'EBF0A022-2C1E-4E30-A3EE-7F99899A47EE', 'If you all agreed to 11, then I️ don’t get why she would write that. Unless she really couldn’t stay until 11 and then she should have just told you that. ', 'Nitzan', 'David', '2024-09-03T22:23:30.201657'),
(59, 'A9097A8C-26F2-4367-842D-A60ADEF8EE19', 'How much do you pay her?  I had told her 11 when I left and she agreed to that…but said that she was confused because you had told her 10. ', 'David', 'Nitzan', '2024-09-03T22:33:39.710000'),
