(31, '58A7C507-169B-4C6E-A4B3-0ADFC39D39CA', 'I️ didn’t mention anything today', 'Nitzan', 'David', '2024-09-03T22:37:06.967056'),
(14, 'EE58220B-BDEC-4BFF-8833-A71BDFE177D7', 'This was my note to you both yesterday “Hi mariela and david. Connecting you two here to coordinate on kid sitting for tomorrow. I️ think david plans to head out at 6:30 and get back at 10ish. But please confirm with him on timing.”', 'Nitzan', 'David', '2024-09-03T22:38:09.762482'),
